import React from 'react';
import './IMA.css';
import { TweenMax, Expo } from 'gsap';

// View IMA Component
export default function ReturnIMA(props) {

 React.useEffect(() => {
  TweenMax.from('.wrp-ima-send img', 1.2, { delay: .8, y: 30, opacity: 0, ease: Expo.easeInOut })

 }, []);

 return (
  <div className='wrp-ima-send'>
   <img src={props.IMA} alt={''} />
  </div>
 );
}
